style.css:
@-moz-document domain("metro-marketplace.cloud") {
#btn-suggested-category {
    display: inline-block;
    outline: 0;
    border: 0;
    cursor: pointer;
    background-color: #86beec;
    border-radius: 4px;
    padding: 15px;
    font-size: 16px;
    border-bottom: 4px solid #2b6cb0;
    font-weight: 700;
    color: #333;
    line-height: 26px;
    position: relative;
    background-image: url('https://cdn-icons-png.freepik.com/512/2324/2324723.png') ;
    background-size: 15%;
    background-repeat: no-repeat;
    background-position: 5% 50%;
    padding-left: 60px;
}
}
